import React from "react";
import Avatar from "./Avatar";

function Card(props){
    return <div>
      
      <div className="card">
    <div className="top">
      <h2 className="name">{props.name}</h2>
      <Avatar image={props.image}/>
    </div>
      <Details tel={props.tel} email={props.email}/>
    </div>
    </div>
}

export default Card;
